// pagination
function createDataForPagination(id, colSize, rowSize) {
    const columns = [];
    for (let i = 0; i < colSize; i++) {
        columns.push({
            name: 'FLD' + i,
            title: 'Column ' + i,
            size: 10,
        });
    }

    const rows = [];
    for (let i = 0; i < rowSize; i++) {
        const currentRow = {};
        const cells = {};

        for (let j = 0; j < columns.length; j++) {
            const cell = {};
            cell.value = i.toString() + j.toString();

            cells[columns[j].name] = cell;
        }

        currentRow.cells = cells;
        rows.push(currentRow);
    }

    const pagination = document.getElementById(id);
    if (pagination != null) {
        pagination.data = {
            columns: columns,
            rows: rows,
        };
        pagination.showFilter = true;
        pagination.globalFilter = true;
        pagination.rowsPerPage = 20;
        /*
        pagination.config = {
            ...pagination.config,
            showFilter: true,
            globalFilter: true,
            rowsPerPage: 20,
        };*/
    }
}

